import React from 'react';

const Users = (props) => {
    return (<div>
        {
        props.users.map(u => {
            return (
                <div key={u.id}>
            <span>
                <div>
                    <img src={u.photoURL} />
                </div>
                <div>Follow</div>
            </span>
            <span>
                <span>
                    <div>{u.fullName}</div>
                    <div>{u.status}</div>
                </span>
                <span>
                    <div>{u.location.city}</div>
                    <div>{u.location.country}</div>
                </span>
            </span>
        </div>
            )
        })
        }
    </div>)
};

export default Users;
